$(document).ready(function() {

	$('.thisc').click(function(event) {
		$( '.thisc' ).each( function () {
		    $(this).removeClass('klikniete')
		});
		$(this).addClass('klikniete');
		$('.dodajosiagniecie').removeClass('disabled');
	});

	$('.dodajosiagniecie').hover(function(event) {
		
		if ($('.wybor.1').hasClass('klikniete')) {
			var numerek = 1;
		}
		if ($('.wybor.2').hasClass('klikniete')) {
			var numerek = 2;
		}
		if ($('.wybor.3').hasClass('klikniete')) {
			var numerek = 3;
		}
		$('.insert_trudnosc').val(numerek);
	});

});
